import React from "react";
import { Link } from "react-router-dom";

const Card = (props) => {
    let id = props.key;
    return (
        <>
            
                <div className="mainCard">
                <Link to ="/prod/" state={{Id: id}}>
                    <img src={props.image} ></img>
                </Link>
                    <div className="detail">
                        <p>{props.name}</p>
                    </div>
                </div>
            
        </>
    );
}
export default Card;
